//import React from "react";
import "./style.css"

const HomePage = ({ onFormSwitch })=>{
    return(
        <body>
            <header>
                <a href="main.html">TradingSimulation</a>
                <nav>
                    {
                        user===null?
                        <a href="../public/index.html">Log In</a>:
                        <a href="profile.html">Profile</a>
                    }
                </nav>
            </header>
            <div className="homeQuote">
            <h1>Practice without risk.<br/>
                Trade with confidence.
            </h1>
            </div>
        </body>
        
    )
}

export default HomePage
